import { Flex, Stack, Text, Container } from "@mantine/core";
import React from "react";

const Drawer = () => {
  return (
    <Stack bg="gray.3">
       <Container
          fluid
          bg="indigo.6"
          style={{
            borderRadius: "5px",
            display: "flex",
            height: "40px",
            alignItems: "center",
            justifyContent: "space-between",
          }}
        >
          <div
            style={{ display: "inline-block", justifyContent: "flex-center" }}
          >
            App Bars
          </div>
          <div style={{ display: "flex", justifyContent: "flex-end" }}>
            <IconCircleXFilled />
          </div>
        </Container>
    </Stack>
  );
};

export default Drawer;
